import React from 'react'
import axios from 'axios'





function App() {

  const getArticles = () =>{
    axios.get("https://flaskreact-n-weektwotes-rkuxmn.herokuapp.com/get")
    .then(response =>{
      console.log(response)
    })
    .catch(error =>{
      console.log(error.message)
    })
  }
  return (
    <div className="App">
      <h1>Howdy!</h1>
      <button onClick={getArticles}>Get Articles</button>
    </div>
  )
}

export default App;
